import React, { Component } from 'react'
import { JobCard } from './Card.styles'

export default class Card extends Component {

  render() {
    console.log(this.props)
    return (
      <JobCard>
        <h1>{this.props.job.title}</h1>
        <p>{this.props.job.description}</p>
        <p>Date</p>
      </JobCard>
    )
  }
}
